import React from 'react'
import Header from './Header'
import Addcontact from './Addcontact'
import Contactlist from './ContactList'
const App = () => {

  const id = [
    {
      id :'1',
    name : 'srikanth',
    email : 'srikanth@123'
    },
    {
      id :'2',
    name : 'srikanth',
    email : 'email'
    }

  ];

  return (
    <div>
      <Header/>
      <Addcontact/>
      <Contactlist id = {id}/>

    </div>
  )
}

export default App
